export const resolvers = {
  Query: {
    authors: () => Author.find()
  },
  Mutation: {
    createAuthor: async (_, {name, age}) => {
      const author = new Author({name, age}) 
      return await author.save()
    },
    deleteAuthor: async (_, {_id}) => {
      return await Author.deleteOne({_id}) 
    }
  }
}

